import * as React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@material-ui/core';

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Tejo', 140, 10.000, '1.400.000', 'admin 1'),
  createData('Joni', 147, 10.000, '1.470.000', 'admin 1'),
  createData('John', 154, 10.000, '1.540.000', 'admin 1'),
  createData('Saprol', 161, 10.000, '1.610.000', 'admin 1'),
];

const pageTransaksi = () => {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Nama Pegawai</TableCell>
            <TableCell align="right">Jumlah Pelayanan</TableCell>
            <TableCell align="right">Harga Pelayanan</TableCell>
            <TableCell align="right">Total Pelayanan</TableCell>
            <TableCell align="right">Create By</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {rows.map((row) => (
          <TableRow
            key={row.name}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
          >
            <TableCell component="th" scope="row">
              {row.name}
            </TableCell>
            <TableCell align="right">{row.calories}</TableCell>
            <TableCell align="right">{row.fat}</TableCell>
            <TableCell align="right">{row.carbs}</TableCell>
            <TableCell align="right">{row.protein}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
    </TableContainer >
  )
}

export default pageTransaksi
